import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";
import ProtectedRoute from "./components/ProtectedRoute";
import AdminLayout from "./components/AdminLayout";
import AdminLogin from "./pages/admin/AdminLogin";
import Dashboard from "./pages/admin/Dashboard";
import Instructors from "./pages/admin/InstructorList";
import Courses from "./pages/admin/CourseList";
import AddCourse from "./pages/admin/AddCourse";
import AddInstructor from "./pages/admin/AddInstructor";
import AddLecture from "./pages/admin/AddLecture";

function App() {
  return (
    <Router>
      <Routes>
        {/* Default route */}
        <Route path="/" element={<Navigate to="/admin/login" />} />

        {/* Public Route */}
        <Route path="/admin/login" element={<AdminLogin />} />

        {/* Protected Routes */}
        <Route
          path="/admin/dashboard"
          element={
            <ProtectedRoute>
              <Dashboard />
            </ProtectedRoute>
          }
        />

        <Route
          path="/admin/instructors"
          element={
            <ProtectedRoute>
              <Instructors />
            </ProtectedRoute>
          }
        />

        <Route
          path="/admin/courses"
          element={
            <ProtectedRoute>
              <Courses />
            </ProtectedRoute>
          }
        />

        <Route
          path="/admin/add-course"
          element={
            <ProtectedRoute>
              <AddCourse />
            </ProtectedRoute>
          }
        />

        <Route
          path="/admin/add-instructor"
          element={
            <ProtectedRoute>
              <AdminLayout>
                <AddInstructor />
              </AdminLayout>
            </ProtectedRoute>
          }
        />

        <Route
          path="/admin/add-lecture"
          element={
            <ProtectedRoute>
              <AddLecture />
            </ProtectedRoute>
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
